        [HttpPost]
        [ValidateAntiForgeryToken]
        [Route("ajax/comunidade/add")]
        public ActionResult CriarCmm(CriarComunidadeModel model)
        {
            using (_uow)
            {
                var comunidade = _comunidadeService.CriarComunidade(model.Nome, model.CategoriaId, model.DescricaoPerfil);
                _membroService.AdicionarMembro(comunidade.Id, PerfilLogged.Id);
                _uow.Commit();

                #region CONFIGURA IMAGE DA CMM

                var dirComunidade = Server.MapPath("~") + "\\Images\\cmm\\" + comunidade.Id.ToString();
                var sourceFileName = Server.MapPath("~") + "\\Images\\cmm\\0.jpg";
                var destFileName = dirComunidade + "\\1.jpg";

                if (!Directory.Exists(dirComunidade))
                    Directory.CreateDirectory(dirComunidade);

                System.IO.File.Copy(sourceFileName, destFileName);

                #endregion

                var url = FuncaoSite.getUrlNomeIdCmm(comunidade.Alias);

                return Json(url);
            }
        }

